import React from 'react';
import logo from './logo.svg';
import './App.css';
import Chart from './components/Chart'

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <Chart />


        <div id="loading_pannel">
        <span className="spinner"></span>
        <p>hello</p>
        </div>


      </header>
    </div>
  );
}

export default App;
